function isValidURL(url){
	if(urlRegExp.test(url)){
		return true;
	}else{
		return false;
	}
}

function trataURL(url){
	if(isValidURL(url)){
		return url;
	}else{
		url = "http://"+url;
		if(isValidURL(url)){
			return url;
		}
	}
	return false;
}

